import React, { Component } from 'react';
import './dash.css';

import ivyiconximg from '../assets/ivyproLogo.png';
import ivyicon2ximg from '../assets/ivyproLogoBlack.png';
import amazon from '../assets/amazon.png';
import ivypro from '../assets/ivypro.png';
import ivyprot from '../assets/ivyproT.png';
import tesla from '../assets/tesla.png';
import teslas from '../assets/tesla-s.png';
import apple from '../assets/apple.png';
import airbnb from '../assets/airbnb.png';
import facebook from '../assets/facebook.png';
import uber from '../assets/uber.jpg';
import google from '../assets/google.png';

import titleximg from '../assets/i-large.png';

class dash extends Component {

  x1min() {
    var x = document.getElementsByClassName("slab-line");
    var i; for (i = 0; i < x.length; i++)
    { x[i].className += " slab-line-out"; };
    var x = document.getElementsByClassName("slab-box");
    var i; for (i = 0; i < x.length; i++)
    { x[i].className += " slab-box-out"; };
    setTimeout(function(){
      var x = document.getElementsByClassName("slab-container");
      var i; for (i = 0; i < x.length; i++)
      { x[i].className += " slab-container-out"; };
  }, 500);
    setTimeout(function(){
      var x = document.getElementsByClassName("main-content");
      var i; for (i = 0; i < x.length; i++)
      { x[i].className += " main-content-out"; };
      var x = document.getElementsByClassName("title-item");
      var i; for (i = 0; i < x.length; i++)
      { x[i].className += " title-item-out"; };
  }, 1000);
  setTimeout(function(){
    var x = document.getElementsByClassName("slab-container");
    var i; for (i = 0; i < x.length; i++)
    { x[i].className += " none"; };
    var x = document.getElementsByClassName("title-spacer");
    var i; for (i = 0; i < x.length; i++)
    { x[i].className += " title-spacer-set"; };
    var x = document.getElementsByClassName("title-item");
    var i; for (i = 0; i < x.length; i++)
    { x[i].className += " title-item-reset"; };
    var x = document.getElementsByClassName("main-content");
    var i; for (i = 0; i < x.length; i++)
    { x[i].className += " main-content-reset"; };
}, 1500);
  }


  render() {
    return (
      <div className="dash">

<div class="modal-intro">

<div class="L-spacer"></div>
  <img src={titleximg} width="357" />
<div class="L-spacer"></div><div class="L-spacer"></div>

<div class="modal-intro-box">
<span class="H-A"><i class="fas fa-arrow-right">&nbsp;&nbsp;</i> <i class="fas fa-shopping-cart grey">&nbsp;&nbsp;</i>Market </span><div class="H-spacer"></div>Investor crowds find companies to buy small equity from and receive a monthly share of profits.
<div class="box-spacer"></div>
<span class="H-A"><i class="fas fa-arrow-right trans">&nbsp;&nbsp;</i> <i class="fas fa-chart-line grey">&nbsp;&nbsp;</i>Doublebox </span><div class="H-spacer"></div> Investors receive [50% profit] from a company until they DOUBLE their MONEY.
<div class="box-spacer"></div>
<span class="H-A"><i class="fas fa-arrow-right trans">&nbsp;&nbsp;</i> <i class="fab fa-adn grey">&nbsp;&nbsp;</i>Angels </span><div class="H-spacer"></div>Fundraisers present ideas to angel investors for seed investments of up to $1 Million.
<div class="box-spacer"></div>
<span class="H-A"><i class="fas fa-arrow-right trans">&nbsp;&nbsp;</i> <i class="fas fa-comment-dollar grey">&nbsp;&nbsp;</i>Sharktank </span><div class="H-spacer"></div> Fundraisers present company Business Plans for investors to bid up to $1 Billion.
{/* <br /><br />
- Cofounder <br /> Find a variety of professionals who will work at your startup for equity. */}
{/* AD: Earn 50% of a company's profit until you DOUBLE your MONEY. */}

</div>
        </div>

<div class="dash-header">
<div class="panel">

  <div class="left-panel">

  {/* <div class="dash-brand none">
  <font class="thick-brand">IVYPRO</font><font class="thin-brand">Equity Market</font>
</div> */}

  <div class="dash-brand-tag ">
  <font class="mid-brand">Equity Market</font>
  </div>

  <div class="dash-brand-icon">
  <div class="rel-icon">
    {/* <img class="none" src={ivyiconximg} width="21px" /> */}
  <i class="material-icons white">insert_chart</i>
  </div>
  </div>

  <div class="left-panel-box">
<div class="left-panel-box-link"></div>

<div class="left-panel-panel">
  <div class="p-back"></div>
  <h4 class="cut-topmargin">C O N C E P T</h4>
    Purchase equity in a company listed on the market
    to collect a portion of it's annual yeild paid monthly.
    <div class="p-back back-2"></div>
  <h4 class="align-leftmargin">I N C E N T I V E S</h4>
  Some companies, especially startups, offer rewards,
   products, or memberships at various tiers of purchase.
   <div class="p-back back-3"></div>
   <h4 class="">V O L U M E</h4>
   A standard unit, one bit: <font class="heavy">.01% Equity</font><br/>
   Some companies may offer microbits.<br/>
   Mbits measure at 1/100th of a bit.
   <div class="p-back back-4"></div>
   <h4 class="">T R A D E</h4>
   You can sell back your equity to the company for its return value,
    or place bids to buy and sell among traders.

    <br/><br/>
    <div class="cr-align-right">
    <font class="created">Created in <font class="heavy">React</font> by</font><font class="created-i"> Ivypro Inc.</font>
    <br/><font class="copy">Copyright 2020</font>
    {/* Established 2020 */}

</div>
</div>
  </div>
  </div>

  <div class="right-panel">
    <div class="right-liner">

              <div class="slab-container">
                  <div class="slab-line"></div>
                  <div class="slab-line line-2"></div>
                  <div class="slab-line line-3"></div>
      <div class="slab-box">
      Use company equity to <font class="tealish">crowdsource</font> funding
    </div>
    <div class="slab-bars" onClick={this.x1min}>
      <i class="fas fa-bars"></i>
    </div>
             </div>

               <div class="main-content">

                 <div class="title-block"><div class="title-item none">New Companies</div></div>
                 <div class="title-spacer"><div class="title-item dent">New Companies</div></div>

               <div class="main-block"><div class="block-img"><img class="logo logo1" src={amazon} /></div>
               <div class="block-stats"><div class="bl-com">Amazon.com</div> <br/>
               <div class="bl-yld"> Yeild: 177B</div><div class="bl-pri">Price: 75k/bit</div></div></div>

               <div class="main-block"><div class="block-img"><img class="logo" src={tesla} /></div>
               <div class="block-stats"><div class="bl-com">Tesla</div> <br/>
               <div class="bl-yld"> Yeild: 11B</div><div class="bl-pri">Price: 12k/bit</div></div></div>

               <div class="main-block"><div class="block-img"><img class="logo" src={uber} /></div>
               <div class="block-stats"><div class="bl-com">Uber</div> <br/>
               <div class="bl-yld"> Yeild: 6.5B</div><div class="bl-pri">Price: 4.2k/bit</div></div></div>

               <div class="main-block"><div class="block-img"><img class="logo" src={airbnb} /></div>
               <div class="block-stats"><div class="bl-com">Airbnb</div> <br/>
               <div class="bl-yld"> Yeild: 2.6B</div><div class="bl-pri">Price: 1.2k/bit</div></div></div>

               <div class="main-block"><div class="block-img"><img class="logo logo2" src={apple} /></div>
               <div class="block-stats"><div class="bl-com">Apple Inc.</div> <br/>
               <div class="bl-yld"> Yeild: 229B</div><div class="bl-pri">Price: 235k/bit</div></div></div>

               <div class="main-block"><div class="block-img"><img class="logo" src={ivyprot} /></div>
               <div class="block-stats"><div class="bl-com">Ivypro Inc.</div> <br/>
               <div class="bl-yld"> Yeild: 28M</div><div class="bl-pri">Price: 2.5k/bit</div></div></div>

               <div class="main-block"><div class="block-img"><img class="logo" src={google} /></div>
               <div class="block-stats"><div class="bl-com">Google</div> <br/>
               <div class="bl-yld"> Yeild: 32B</div><div class="bl-pri">Price: 10k/Mbit</div></div></div>

               <div class="main-block"><div class="block-img"><img class="logo logo3" src={facebook} /></div>
               <div class="block-stats"><div class="bl-com">Facebook</div> <br/>
               <div class="bl-yld"> Yeild: 27B</div><div class="bl-pri">Price: 24k/bit</div></div></div>

             </div>

    </div>
  </div>

</div>
</div>

      </div>
    );
  }
}

export default dash;
